import React from "react";
import styled from "styled-components";
import { Button } from "antd";

export const OptionBtn = styled(Button)`
	background: #eeeeee;
	color: #000000;
	border: none;

	font-size: 15px;
	display: block;
	margintop: 10px;

	&:hover {
		background: #0984e3;
		color: #ffffff;
	}
`;
